// import Register from "../Register/Register";
// import Login from "../Login/Login";
// import Profile from "../Profile/Profile";

const App = () => {

  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<Header/>}>
          <Route index element={<Main/>} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
